import React, { Component } from 'react';
import ReactPlayer from "react-player"

class VideoPlayer extends Component {

    render() {
        return (
            <div>
                {(this.props.videoId !== '') 
                    ? <ReactPlayer url={`https://www.youtube.com/watch?v=${this.props.videoId}`} controls={true}/>
                    : <p>Select A Video</p>
                }
            </div>
        );
    }
}

export default VideoPlayer;
